const myImage = new Image();
myImage.src =
  "data:image/png;base64,";
myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas");
  const ctx = canvas.getContext("2d");
  canvas.width = 600;
  canvas.height = 700;

  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  // console.log(pixels);

  let particlesArray = [];
  const numberOfParticles = 4000;

  let mappedImage = [];

  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [(cellBrightness = brightness)];
      row.push(cell);
    }
    mappedImage.push(row);
  }
  console.log(mappedImage);

  function calculateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.6; //
      this.size = Math.random() * 1.5 * Math.random() * 2 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
    }
    // update() {
    //   this.position1 = Math.floor(this.y);
    //   this.position2 = Math.floor(this.x);
    //   this.speed = mappedImage[this.position1][this.position2][0];
    //   let movement = 2.5 - this.speed + this.velocity;

    //   this.y += movement;
    //   if (this.y >= canvas.height) {
    //     this.y = 0;
    //     this.x = Math.random() * canvas.width;
    //   }
    // }
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);

      const minSpeed = 0.1; // Мінімальне значення швидкості
      const maxSpeed = 3.5; // Максимальне значення швидкості

      // Задаємо випадкову швидкість для кожної частинки
      this.speed = Math.random() * (maxSpeed - minSpeed) + minSpeed;

      let movement = 2.5 - this.speed + this.velocity;

      this.y += movement;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }
    // draw() {
    //   ctx.beginPath();
    //   ctx.fillStyle = "red";
    //   ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
    //   ctx.fill();
    // }
    draw() {
      const pixelData = pixels.data;
      const pixelIndex = (this.position1 * canvas.width + this.position2) * 4;
      const red = pixelData[pixelIndex];
      const green = pixelData[pixelIndex + 1];
      const blue = pixelData[pixelIndex + 2];

      ctx.beginPath();
      ctx.fillStyle = `rgb(${red}, ${green}, ${blue})`;
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }

  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particlesArray.push(new Particle());
    }
  }
  init();

  function animate() {
    // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.5;
    ctx.fillStyle = "rgba(0,0,0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.1;
    for (let i = 0; i < particlesArray.length; i++) {
      particlesArray[i].update();
      ctx.globalAlpha = particlesArray[i].speed * 0.5;
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});
